import React from 'react';

const Form = () => {
	return (

	<div>
		<h1>Get in Touch</h1>
		<p>Please fill out the quick form and we will be in touch with lightening speed.</p>
		<input type="email" name="email" placeholder="Your Email address" /><br/>
		<input type="textarea" name="message" placeholder="Message" rows="8" cols="40" maxlength="200"/>
		<input type="submit" name="submit" />
	</div>

		)
}

export default Form;
